import { Row } from "react-bootstrap";
import MovieCard from "./MovieCard";


function MovieList({movies}) {
    // console.log(movies);
    return (
        <Row>
            
            { movies.length >= 1?(movies.map((item) => {
                return(
                    <MovieCard />
                )
            })) : <h2>data not found</h2>}
        </Row>
    )
}

export default MovieList ;
